import React, { Component } from "react";

class Navbar extends Component {
  state = {};
  render() {
    return (
      <div styles={this.getstyles()}>
        <span>terve</span>
        <button style={{ marginLeft: "10px" }}>Uusi kalenteri</button>

        <button style={{ marginRight: "10px", float: "right" }}>
          Uusi kalenteri
        </button>
        <input
          type="text"
          placeholder="Hae Kalenteria"
          style={{ marginRight: "10px", float: "right" }}
        ></input>
      </div>
    );
  }

  getstyles() {
    let styles = "background-color: lightblue";
    return styles;
  }
}

export default Navbar;
